// InputField.js
import React from 'react';
import TextInput from './TextInput'; // TextInput 컴포넌트 가져오기
import SUbButton from './SubButton'; // SubButton 컴포넌트 가져오기

const InputField = ({ label, id, type, placeholder, showButton }) => {
    return (
        <div className={`${id}_input`}>
            <div className="sub_title">
                <div>{label}</div>
                <div className="asterisk">*</div>
            </div>
            <TextInput
                type={type}
                id={id}
                placeholder={placeholder}
                marginbottom="0px"
                autoFocus
            />
            {showButton && <SUbButton>중복 확인</SUbButton>}
        </div>
    );
};

export default InputField;
